import React from "react";
import Tour from './Tour'
import { Container, Row, Col } from "react-bootstrap";

const Tours = ({ tours }) => {
    return (
        <Container>
            <Row>
            {tours.map((tour) => {
                return <Tour key={tour.id} {...tour}></Tour>
            })}
            </Row>
        </Container>
    );
};

export default Tours;
